import React,{useState}from 'react'
import "../styles/navbar.css"
import { FaBars, FaTimes } from 'react-icons/fa';
const Navbar1 = () => {

  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };
  const menuclose = () => {
    setIsOpen(false); 
  };
  return (
    <div className="navbar">
      <div className='navbrand'>Praveen S</div>
      <div className="menu-icon" onClick={toggleMenu}>
        {isOpen ? <FaTimes size={30} color="#fff" /> : <FaBars size={30} color="#fff" />}
      </div>
      <ul className={`nav-list ${isOpen ? 'open' : ''}`}>
        <li className="nav-item"><a href="#about" onClick={menuclose}>About me</a></li>
        <li className="nav-item"><a href="#education">Education</a></li>
        <li className="nav-item"><a href="#skill">Skill</a></li>
        <li className="nav-item"><a href="#pro">Skill</a></li>
      </ul>
    </div>


  )
}
export default Navbar1
